Join Green Bay Packers left tackle David Bakhtiari as he co-hosts Clubhouse Live, Gannett Wisconsin Media's live weekly pro football show Monday at 6:30 p.m. from The Clubhouse Sports Pub & Grill in downtown Appleton. Bakhtiari's guest will be rookie wide receiver Ty Montgomery! 
They’ll look back on the Packers’ Week 6 showdown against the Chargers and give you a glimpse into their lives away from football through a fun and interactive discussion with co-hosts Brett Christopherson and Ricardo Arguello. Read or Share this story: http://pck.rs/1LDlXO4 MORE STORIES
